import React, { Component } from "react";

class Other extends Component {
    render() {
        return (
            <div id="otherDiv">
                <h2>Other Kits & Products</h2>
                <p>Here you can find an assortment of other kit that we offer.</p>
                <ul>
                    <li>Vehicle Kits</li>
                    <li>Haru</li>
                    <li>1088 Gunpla</li>
                    <li>Anime Figures</li>
                </ul>
            </div>
        );
    }
}

export default Other;
